  %include "../../defaults_bin.asm"

  ; Determine and print phase
  lockstep 1
  mov ax,cs
  mov es,ax
  mov ds,ax
  mov di,data2

  in al,0x21
  mov [imr],al
  mov al,0xfe  ; Enable IRQ0 (timer), disable all others
  out 0x21,al

  in al,0x61
  or al,3
  out 0x61,al

  mov al,TIMER2 | BOTH | MODE2 | BINARY
  out 0x43,al
  mov dx,0x42
  mov al,0
  out dx,al
  out dx,al

  %rep 5
    readPIT16 2
    stosw
  %endrep

  refreshOn

  mov ax,'0'
  mov di,[data2+8]
  mov si,[data2+6]
  mov bx,[data2+4]
  mov cx,[data2+2]
  mov dx,[data2]
  sub dx,cx
  sub dx,20
  jnz notPhase0
  add ax,1
notPhase0:
  sub cx,bx
  sub cx,20
  jnz notPhase1
  add ax,2
notPhase1:
  sub bx,si
  sub bx,20
  jnz notPhase2
  add ax,4
notPhase2:
  sub si,di
  sub si,20
  jnz notPhase3
  add ax,8
notPhase3:

  sti
  outputCharacter
  mov al,13
  outputCharacter
  cli


  mov di,startAddresses
  mov ax,cs
  mov es,ax
;  xor ax,ax
  mov ax,-1
  mov cx,200
initAddressesLoopTop:
  stosw
  inc ax
  inc ax
;  add ax,2 ;40
  loop initAddressesLoopTop

  mov di,rasterData
  xor ax,ax
  mov cx,200
initRastersLoopTop:
  stosb
  inc ax
  loop initRastersLoopTop



  mov ax,0xb800
  mov es,ax
  mov ax,cs
  mov ds,ax
  mov si,data
  xor di,di
  mov cx,8000
  cld
  rep movsw

restart:

  sti
  mov ax,[cs:adjustPeriod]
  outputHex
  mov al,32
  outputCharacter
  mov ax,[cs:refreshPhase]
  outputHex
  mov al,13
  outputCharacter
;  captureScreen

  lockstep 1
;  cli

  ; Mode
  ;      1 +HRES
  ;      2 +GRPH
  ;      4 +BW
  ;      8 +VIDEO ENABLE
  ;   0x10 +1BPP
  ;   0x20 +ENABLE BLINK
  mov dx,0x3d8
  mov al,9
  out dx,al

  ; Palette
  ;      1 +OVERSCAN B
  ;      2 +OVERSCAN G
  ;      4 +OVERSCAN R
  ;      8 +OVERSCAN I
  ;   0x10 +BACKGROUND I
  ;   0x20 +COLOR SEL
  inc dx
  mov al,0
  out dx,al

  mov dl,0xd4
  mov ax,0x7100
  out dx,ax
  mov ax,0x5001
  out dx,ax
  mov ax,0x5a02
  out dx,ax
  mov ax,0x0f03
  out dx,ax
  mov ax,0x3f04
  out dx,ax
  mov ax,0x0005
  out dx,ax
  mov ax,0x0206
  out dx,ax
  mov ax,0x1907
  out dx,ax
  mov ax,0x0008
  out dx,ax
  inc ax
  out dx,ax
  mov ax,0x060a
  out dx,ax
  mov ax,0x070b
  out dx,ax
  mov ax,0x000c
  out dx,ax
  inc ax
  out dx,ax
  mov ax,0x3f0e
  out dx,ax
  mov ax,0xff0f
  out dx,ax
  mov dl,0xda
  waitForNoVerticalSync
  waitForVerticalSync
  waitForDisplayEnable
  mov ax,0x0104
  mov dl,0xd4
  out dx,ax
;  safeRefreshOff

  writePIT16 0, 2, 2   ; Ensure IRQ0 pending

  xor ax,ax
  mov ds,ax
  mov word[0x20],interrupt8h0
  mov [0x22],cs

  mov dl,0xda
  waitForDisplayDisable
  waitForDisplayEnable

  writePIT16 0, 2, 31

  sti
  hlt
interrupt8h0:
  mov al,75                 ; Now counting down from 31
  out 0x40,al
  mov al,0
  out 0x40,al
  mov word[0x20],interrupt8h1
  mov al,0x20
  out 0x20,al
  sti
  hlt

interrupt8h1:
  in al,dx                  ; Now counting down from 75
  test al,1
  jz .noInterruptChange  ; jump if +DISPEN, finish if -DISPEN
  mov word[0x20],interrupt8h2
.noInterruptChange:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8h2:
  mov ax,[cs:refreshPhase]     ; We're still counting down from 75
  out 0x40,al
  mov al,ah
  out 0x40,al
  mov word[0x20],interrupt8h3
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8h3:
  mov word[0x20],interrupt8h4  ; We're still counting down from refreshPhase
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8h4:
  refreshOn 19                 ; refreshPhase has happened, restart refresh
  mov al,0x20
  out 0x20,al
  mov sp,stackTop

  mov dl,0xd4
  mov ax,0x3f04
  out dx,ax

  mov dl,0xda
  waitForNoVerticalSync
  waitForVerticalSync
  waitForDisplayEnable

  writePIT16 0, 2, 76*64 - 1  ; Start counting down after display enable starts

  mov word[0x20],interrupt8a

  sti
  hlt
interrupt8a:
  in al,dx
  test al,1
  jz .noInterruptChange  ; jump if +DISPEN, finish if -DISPEN
  mov word[0x20],interrupt8b
.noInterruptChange:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8b:
  mov ax,[cs:adjustPeriod]     ; We're still counting down from 76*64 - 1
  out 0x40,al
  mov al,ah
  out 0x40,al
  mov word[0x20],interrupt8c
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
  sti
  hlt

interrupt8c:
  mov ax,(76*262) & 0xff        ; We're still counting down from adjustPeriod
  out 0x40,al
  mov al,(76*262) >> 8
  out 0x40,al
  mov word[0x20],interrupt8
  mov al,0x20
  out 0x20,al
  mov sp,stackTop
    mov dx,0x3d9
  sti
  hlt

interrupt8:
    out dx,al
  mov ax,cs
  mov ds,ax
  mov ss,ax
  mov sp,startAddresses
  mov dx,0x3d4
  mov bp,0x5001
  mov di,0x1900
  mov ax,0x5702
  mov si,sampleData
  mov bx,rasterData-sampleData
  mov es,ax

  ; Scanlines -1..198

%macro scanline 1
  mov al,0x00
  out dx,ax        ; e  Horizontal Total         left  0x5700  88

  mov ax,0x0202
  out dx,ax        ; f  Horizontal Sync Position right 0x0202   2

  pop cx
  mov al,0x0c
  mov ah,ch
  out dx,ax
  inc ax
  mov ah,cl
  out dx,ax

  lodsb
  out 0xe0,al

  %if %1 == -1
    mov ax,0x0104
    out dx,ax      ;    Vertical Total
    times 3 nop
  %elif %1 == 198
    mov ax,0x3f04
    out dx,ax      ;    Vertical Total                 0x3f04  64  (1 for scanlines -1 and 198, 62 for scanlines 199-260)
    times 3 nop
  %else
    mov al,[bx+si]
    mov dl,0xd9
    out dx,al
    mov dl,0xd4
  %endif

  mov ax,0x0101
  out dx,ax        ; b  Horizontal Displayed     right 0x0101   1
  xchg ax,di
  out dx,ax        ; a  Horizontal Total         right 0x1900  26
  xchg ax,di
  xchg ax,bp
  out dx,ax        ; d  Horizontal Displayed     left  0x5001  80
  xchg ax,bp
  mov ax,es
  out dx,ax        ; c  Horizontal Sync Position left  0x5702  88
%endmacro
%assign i -1
%rep 200
  scanline i
  %assign i i+1
%endrep

  ; Scanline 199

  mov ax,0x7100
  out dx,ax        ; e  Horizontal Total         left  0x7100 114
  mov ax,0x5a02
  out dx,ax        ; f  Horizontal Sync Position right 0x5a02  90

    times 72 nop
    mov dl,0xd9
    mov al,6
    out dx,al

;  times 11 nop  ; TODO: tune
;
;  lodsb
;  out 0xe0,al
  ; TODO: We are now free to do per-frame vertical-overscan stuff
  ; with no special timing requirements except:
  ;   HLT before overscan is over
  ;   Sound (if in use)

  in al,0x60
  xchg ax,bx
  ; Acknowledge the previous byte
port61high:
  mov al,0xcf
  out 0x61,al
port61low:
  mov al,0x4f
  out 0x61,al
  cmp bl,1
  je tearDown
  cmp bl,0x4b
  je moveLeft
  cmp bl,0x4d
  je moveRight
  cmp bl,0x48
  je moveUp
  cmp bl,0x50
  je moveDown
  cmp bl,0x4a
  je decreaseRefreshPhase
  cmp bl,0x4e
  je increaseRefreshPhase
  cmp bl,0x49
  je moveLeft5
  cmp bl,0x51
  je moveRight5

finishInterrupt:
  mov al,0x20
  out 0x20,al
    mov dx,0x3d9
    mov al,1
  mov sp,stackTop
  sti
  hlt

tearDown:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop

  writePIT16 0, 2, 0
  xor ax,ax
  mov ds,ax
  mov word[0x20],dummyInterrupt8

  complete


moveLeft:
  dec word[adjustPeriod]
  jmp doneFrame
moveRight:
  inc word[adjustPeriod]
  jmp doneFrame
moveUp:
  sub word[adjustPeriod],76
  jmp doneFrame
moveDown:
  add word[adjustPeriod],76
  jmp doneFrame
decreaseRefreshPhase:
  dec word[refreshPhase]
  cmp word[refreshPhase],64-1
  jne doneFrame
  mov word[refreshPhase],64+18
  jmp doneFrame
increaseRefreshPhase:
  inc word[refreshPhase]
  cmp word[refreshPhase],64+19
  jne doneFrame
  mov word[refreshPhase],64+0
  jmp doneFrame
moveLeft5:
  sub word[adjustPeriod],5
  jmp doneFrame
moveRight5:
  add word[adjustPeriod],5


doneFrame:
  mov al,0x20
  out 0x20,al
  mov sp,stackTop

  writePIT16 0, 2, 0
  xor ax,ax
  mov ds,ax
  mov word[0x20],dummyInterrupt8

  jmp restart

dummyInterrupt8:
  push ax
  mov al,0x20
  out 0x20,al
  pop ax
  iret

slide:
  times 38 nop
  ret



startAddresses:
  times 200 dw 0
rasterData:
  times 200 db 0
sampleData:
  times 200 db 0
adjustPeriod:
  dw 0x13d4 ;76*64      phase4: 1332-1336, 129a-129e, 13d9-13dd, phase2: 138d-1391
imr: db 0
refreshPhase: dw 64

